    this.props.history.push("/chongqing-house");
  }
  goGooey = () => {
    this.props.history.push("/gooey");
  }
  render() {
    return (
      <div class="about">
        <Header goToHome={this.goHome} goToAbout={this.goAbout} page={"about"}/>
        <div class="intro">

        </div>
        <div className = "footercenter">
          <Footer />
        </div>
      </div>
    );
  }
}

export default About;
